{
    "name": "HedgeAnomaly",
    "type": "Anomaly",
    "jobScript": "",
    "description": "CA This is predefined algorithm template to train anomaly model using autoencoder, the output is a model that will be deployed at customer edge",
    "productType": "IOT",
    "algorithmSchema": {
        "$schema": "http://json-schema.org/draft-06/schema#",
        "$ref": "#/template/definition",
        "template": {
            "definition": {
                "type": "object",
                "additionalProperties": false,
                "properties": {
                    "input": {
                        "$ref": "#/template/input"
                    },
                    "config": {
                        "$ref": "#/template/config"
                    }
                },
                "title": "HedgeAlgorithmSchema"
            },
            "input": {
                "type": "object",
                "additionalProperties": true,
                "properties": {
                    "training_input_fileId": {
                        "type": "string"
                    }
                },
                "title" : "Runtime parameters to initiate train job for Hedge Autoencoder"
            },
            "config": {
                "type": "object",
                "additionalProperties": false,
                "properties": {
                    "name": {
                        "type": "string",
                        "const": "AutoEncoder"
                    },
                    "batch_size": {
                        "type": "integer"
                    },
                    "num_epochs": {
                        "type": "integer"
                    }
                },
                "title": "ConfigSchema"
            }
        }
    }
}

{
    "templateId": "{{templateId}}",
    "name": "HedgeAnomaly222222_2_312",
    "description": "Hedge Anomaly algo instance, hyperparameters to be passed as env var in jobScript, while runtime parmeters is provide in the config file",
    "enable": "true",
    "executionMode": "OnDemand",
    "definition": {
        "input": {
            "training_data_fileId": "{{training_data_fileId}}",
            "training_config_fileId": "{{training_config_fileId}}",
            "training_job_fileId" : "{{training_job_fileId}}"
        }
    }
}

{
    "templateId" : "b558d267-c958-4c4d-8734-b40b0961fdd9",
    "name" : "Clustering algo instance 7",
    "description" : "this algo instnace is for CSV",
    "definition": {
    "input": {
      "fileId": "{{fileId}}",
      "scoringSlot": "severity",
      "inputSlots": [
        "Description"
      ],
      "outputSlots": [
        "ServiceCI"
      ],
      "scoringFunction": "max",
      "categorySlot": "Operational Categorization Tier 2"
    },
    "config": {
      "params": {
        "k": 10,
        "initMethod": "k-means++" ,
        "maxIteration": 100,
        "nInit": 10,
        "tolerance": 0.8,
        "algorithm": "full"
      }
    }
  }
}

